import './Pages.css';
function Login() {
  return (
    <div className="signin-container" dir="rtl">
      <h2 className="signin-title">כניסה לחשבון</h2>
      <form className="signin-form">
        <input type="text" placeholder= "שם משתמש" className="signin-input" />
        <input type="password" placeholder="סיסמא" className="signin-input" />
        <div className="signin-buttons">
          <button type="submit" className="signin-btn">הכנס</button>
          <button type="button" className="signin-btn">הרשם</button>
        </div>
      </form>
    </div>
  );
}

export default Login;
